import React, { useEffect } from "react";
import SearchedResultVideos from "./SearchedResultVideos";
import { useSelector } from "react-redux";
import { useState } from "react";


const SearchResults = () => {

    console.log("inside searchResults");

    const [searchList, setSearchList] = useState([]);

    const searchQueryString = useSelector((store) => store.search.searchQuery);
    useEffect(()=>{
        fetchData();
    },[])
    const fetchData = async() =>{
        const data = await fetch("https://youtube.googleapis.com/youtube/v3/search?part=snippet&maxResults=25&q=m4tech&key=AIzaSyDmG0ixJl2PETtD8O_M2hhOhPwIBk_tBCA");
        const json = await data.json();
        setSearchList(json.items);
        //console.log(json.items);
    }
  return (
    <div>

        {
          searchList.map((data) => {
            return <SearchedResultVideos key={data.id} data={data}/>
          })
        }





    </div>
  );
};

export default SearchResults;
